?EXHIBIT A
SHARED INTERCONNECTION FACILITIES

The “Shared Interconnection Facilities” shall consist of the following facilities: 
· A seventy-six (76) mile overhead 345 kV line to connect the Soldier Creek substation to the Point of Interconnection (POI) at the 345 kV deadend structure at existing Transmission Owner substation (Stranger Creek) that is owned and maintained by Transmission Owner; 
· A fixed Series Capacitor with an impedance of 31.5 Ohms installed at the mid-point of the Soldier Creek to Stranger Creek 76 mile 345kV interconnection tie-line for the mitigation of a low Short Circuit Ratio (SCR) condition at High Banks.  
· Equipment at the Soldier Creek Substation including 3 total breakers (2 line breakers,  1 reactor breaker, and 2 shunt capacitor breakers), 1 HV reactor, 2 HV shunt capacitor banks, 8 HV disconnect switches, 2 sets of CCVTs, 1 set of VTs;
· A twenty-five (25) mile overhead 345 kV line to connect the Irish Creek substation to the Soldier Creek substation;
· Equipment at the Irish Creek Substation including 2 line breakers, 3 HV disconnect switches, 2 sets of CCVTs; and
· All necessary relay, protection, control and communication systems required to protect Interconnection Customer’s Interconnection Facilities and Generating Facility and coordinate with Transmission Owner’s relay, protection, control, and communication systems. 

All other facilities owned by Soldier Creek, Irish Creek or High Banks shall not constitute “Shared Interconnection Facilities” for purposes of this Agreement.
